function PaletteList(props){

    const history = useHistory();
    
    function handlePalettes(id){
        history.push(`/palette/${id}`)
    };
    // const {classes} = props
    return (
        <div className="root">
            <div className="container">
                <nav className="nav">
                <h1>React Colors</h1>
                </nav>
                <div className="palette">
                {props.palettes.map(color => (

                    <MiniPalette {...color} handlePalette={()=> handlePalettes(props.palettes.id)}/>
                    // <p>
                    //     <Link to={`/palette/${color.id}`}>{color.paletteName}</Link>
                    //     {console.log(color.id)}
                    // </p>
                ))}
                </div>
            </div>
        </div>
    )
}

